import React, { useState } from 'react'
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import { Typography, FormControl, Select, MenuItem, InputLabel } from '@mui/material';
import Container from '@mui/material/Container';
import dayjs from 'dayjs';
import { DemoContainer } from '@mui/x-date-pickers/internals/demo';
import { LocalizationProvider } from '@mui/x-date-pickers';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { Link } from "react-router-dom";


import "./style.css";

const cards = [1, 2, 3, 4, 5, 6, 7, 8, 9];


export function DatePickerValue() {
  const [value, setValue] = useState(dayjs('2022-04-17'));
  const [age, setAge] = React.useState('');

  const handleChange = (event) => {
    setAge(event.target.value);
  };


  return (
    <FormControl fullWidth>
      <LocalizationProvider dateAdapter={AdapterDayjs}>
        <DemoContainer components={['DatePicker', 'DatePicker']}>
          <input type='text' placeholder='Search City ...' style={{ fontSize: 17, fontWeight: 'bold' }} />

          <DatePicker label="Start date" defaultValue={dayjs('2022-04-17')} />
          <DatePicker
            label="Controlled picker"
            value={value}
            onChange={(newValue) => setValue(newValue)}
          />

          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={handleChange}
            sx={{ width: 150 }}
          >
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
          <Button variant="contained" >
            Success
          </Button>
        </DemoContainer>
      </LocalizationProvider>

    </FormControl>

  );
}


function index() {
  return (
    <React.Fragment>
      <Box sx={{ border: '1px solid red', width: "90%", m: "auto", mt: 3, p: 3 }}>
        <DatePickerValue />
      </Box>
      <Box
        sx={{
          bgcolor: 'background.paper',
          pt: 8,
          pb: 8,
        }}
      >
        <Container maxWidth="sm">
          <Typography
            component="h1"
            variant="h2"
            align="center"
            color="text.primary"
            gutterBottom
            sx={{ fontWeight: "bold" }}
          >
            Tunisian hotels
          </Typography>
          <Typography variant="h5" align="center" color="text.secondary" paragraph>
            On BookingRBK, you can now book online
            your Tunisia hotel in dinars,
            Click Here For More Informations
            <Link to='/' style={{ textDecoration: "none", display: "block" }}>
              <Button variant="contained" sx={{ mt: 2 }}>About Our Services
              </Button></Link>
          </Typography>

        </Container>
      </Box>

      <Container sx={{ py: 4 }} maxWidth="md">
        {/* End hero unit */}
        <Grid container spacing={4} >
          {cards.map((card) => (
            <Grid item key={card} xs={12} sm={6} md={4}>
              <Card
                sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}
                id="CardItem"
              >
                <CardMedia
                  component="img"
                  sx={{ height: 250 }}
                  image="https://source.unsplash.com/random"
                  alt="random"
                />
                <CardContent sx={{ flexGrow: 1 }}>
                  <Typography gutterBottom variant="h5" component="h2">
                    London
                  </Typography>
                  <Typography>
                    This is a media card. You can use this section to describe the
                    content.
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button size="small">View</Button>
                  <Button size="small">Edit</Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </React.Fragment>
  )
}

export default index
